import 'package:hlshop/all_file/all_file.dart';import 'package:dio/dio.dart';part 'rating_api.g.dart';@RestApi()abstract class RatingApi {  factory RatingApi(Dio dio) = _RatingApi;  @GET('/api/hlshop/rating/get-ratings-by-product')  Future<RatingModel?> getRatingByProduct({    @Query('offset') int? offset,    @Query('limit') int? limit,    @Query('product_id') String? productId,    @Query('type') int? type,    @Query('filter') int? filter,  });  @POST('/api/hlshop/rating/upload-image')  Future<UploadImageModel?> uploadImage({    @Part() File? file,  });}